import React from 'react'
import { Outlet, Link, useNavigate } from "react-router-dom";
import Home from './components/Home.jsx';
import {GlobalStyle, StyledFieldset, StyledButton} from "./components/Style.js"

function Survey() {

  function navigateTo(link) {
    navigate(link)
  }

  return (
    <>
    <GlobalStyle/>
      <nav>
        <ul>
          <div>
            <StyledButton onClick={navigateTo("/Home")}>Start Survey</StyledButton>
          </div>
        </ul>
      </nav>

      <Outlet />

    </>
  )
}

export default Survey;
